import { Link } from 'react-router-dom';

export default function Top () {
    const iconStyle = { padding: 10, fontSize: 50 };
    return (
        <div className="top">
            <div className="pankuzu">
                <li></li>
                <a href="/"><FontAwesomeIcon icon={faHome} color={"gray"} /></a>
                <a href="/"><FontAwesomeIcon icon={faHome} color={"gray"} /></a>
            </div>
        </div>
    )   
}
